package logging

import (
	"testing"

	"go.uber.org/zap/zapcore"
)

// LoggableStringArray mimics caddyhttp.LoggableStringArray
type LoggableStringArray []string

func (sa LoggableStringArray) MarshalLogArray(enc zapcore.ArrayEncoder) error {
	for _, s := range sa {
		enc.AppendString(s)
	}
	return nil
}

func TestCookieFilterWithArray(t *testing.T) {
	f := CookieFilter{[]cookieFilterAction{
		{Type: replaceAction, Name: "sessionid", Value: "REDACTED"},
	}}

	// Simulate what caddyhttp does: passing a LoggableStringArray
	cookies := LoggableStringArray{
		"myvalue=1; sessionid=ST1LLh3r3",
	}

	// zap.Array("Cookie", cookies) creates a field with Type=ArrayMarshalerType and Interface=cookies
	field := zapcore.Field{
		Key:       "Cookie",
		Type:      zapcore.ArrayMarshalerType,
		Interface: cookies,
	}

	out := f.Filter(field)

	// We expect the output to be filtered.
	// Since the input was an array, the output should probably also be an array (or at least contain the filtered data).
	// If the filter works correctly, it should have modified the Interface or converted it to a String with filtered content.

	// However, since we can't easily modify the Interface in place if it's a slice (unless we replace the slice),
	// let's see what happens.

	// If the fix converts it to a string (joined by ;), that's one way.
	// Or it returns a new LoggableStringArray with filtered strings.

	// For now, let's just check if the output contains the redacted value.

	// If the current implementation does nothing to Interface, it will still contain the original data.

	// Let's inspect the output.

	// If the type is still ArrayMarshalerType, we need to check the Interface.
	if out.Type == zapcore.ArrayMarshalerType {
		if val, ok := out.Interface.(LoggableStringArray); ok {
			if len(val) > 0 && val[0] == "myvalue=1; sessionid=ST1LLh3r3" {
				t.Fatalf("Cookie was not redacted! Got: %v", val)
			}
		} else {
			// It might be that the filter didn't change the type but didn't touch the interface?
			// Or maybe it's a different type now?
		}
	} else if out.Type == zapcore.StringType {
		// If it converted to string
		if out.String == "myvalue=1; sessionid=ST1LLh3r3" {
			t.Fatalf("Cookie was not redacted! Got: %s", out.String)
		}
	}

	// To be more precise, we expect "sessionid=REDACTED"

	foundRedacted := false
	if out.Type == zapcore.ArrayMarshalerType {
		if val, ok := out.Interface.(LoggableStringArray); ok {
			for _, s := range val {
				if s == "myvalue=1; sessionid=REDACTED" {
					foundRedacted = true
				}
			}
		}
	} else if out.Type == zapcore.StringType {
		if out.String == "myvalue=1; sessionid=REDACTED" {
			foundRedacted = true
		}
	}

	if !foundRedacted {
		t.Errorf("Expected cookie to be redacted to 'sessionid=REDACTED', but it wasn't. Output: %+v", out)
	}
}
EOF
"}

